INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0.029, 110, 1, 101, 1.5, 105, 0, 1, 122601, 0, 1, 1, 160);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0.014, 105, 3, 102, 2.5, 111, 1, 0, 122401, 0, 2, 2, 120);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0.017, 110, 2, 103, 2.5, 105, 0, 0, 122501, 1, 3, 3, 350);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0.016, 110, 3, 104, 1.5, 105, 1, 0, 107501, 0, 4, 4, 130);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0.014, 110, 1, 105, 2.5, 105, 0, 1, 107601, 0, 5, 5, 160);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0.029, 120, 2, 106, 3.5, 103, 0, 0, 107801, 1, 6, 6, 255);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0.013, 120, 1, 107, 3.5, 103, 0, 1, 110601, 0, 7, 7, 160);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0.014, 110, 2, 108, 2.5, 103, 0, 0, 110401, 1, 8, 8, 350);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0.012, 105, 3, 109, 1.5, 100, 1, 0, 110501, 0, 9, 9, 130);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0.014, 105, 1, 110, 2.5, 103, 0, 1, 115701, 0, 10, 10, 200);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0.071, 105, 2, 111, 2.5, 103, 0, 0, 113601, 1, 11, 11, 350);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0.014, 120, 3, 112, 1.5, 103, 1, 0, 107901, 0, 12, 12, 130);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0.022, 110, 2, 113, 1.5, 105, 0, 1, 108001, 0, 13, 13, 200);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0.031, 110, 1, 114, 2.5, 108, 0, 1, 110301, 0, 14, 14, 160);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0.036, 110, 1, 115, 0.5, 105, 1, 0, 107701, 0, 15, 15, 130);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0.048, 110, 2, 116, 3.5, 95, 0, 0, 113101, 1, 16, 16, 350);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0.043, 105, 3, 117, 1.5, 105, 1, 0, 113301, 0, 17, 17, 130);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0.018, 105, 2, 118, 1.5, 95, 1, 0, 113201, 0, 18, 18, 130);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0.021, 110, 2, 119, 2.5, 108, 0, 1, 117001, 0, 19, 19, 160);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0.036, 110, 1, 120, 2.5, 105, 0, 0, 113501, 1, 20, 20, 255);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0.02, 105, 3, 121, 2.5, 105, 0, 0, 113401, 1, 21, 21, 350);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0.018, 110, 1, 122, 2.5, 105, 1, 0, 110101, 0, 22, 22, 130);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0.03, 105, 3, 123, 3.5, 111, 0, 1, 110001, 0, 23, 23, 160);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0.027, 110, 1, 124, 1.5, 103, 1, 0, 117201, 0, 24, 24, 130);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0.02, 105, 2, 125, 3.5, 108, 0, 1, 117301, 0, 25, 25, 160);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0.04, 110, 3, 126, 2.5, 105, 0, 0, 117401, 1, 26, 26, 350);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0.009, 110, 1, 127, 3.5, 105, 0, 0, 117101, 1, 27, 27, 350);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0.022, 120, 1, 128, 3.5, 105, 0, 0, 122901, 1, 28, 28, 255);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0.028, 110, 3, 129, 2.5, 105, 1, 0, 122801, 0, 29, 29, 130);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES ("海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0.023, 105, 2, 130, 3.5, 108, 0, 1, 122701, 0, 30, 30, 130);
